import Sign_up from "./component/Sign_up";
import "./App.css";
import Connect from "./component/Connect";
import { Route, Routes, Link } from "react-router-dom";
import Merchant_login from "./component/Merchant_login";
Merchant_login
function App() {
  return (
    <div className="App">
      <Sign_up />

      <Link to="/">Home</Link>
      <Link to="Merchant_login">Page 1</Link>
      <Link to="page2">Page 2</Link>
      <Link to="page3">Page 3</Link>
      <Routes>
        <Route path="/" element={<Sign_up />} />
        <Route path="/Merchant_login" element={<Merchant_login />} />
      </Routes>
    </div>
  );
}

export default App;
